/**
 * Developer Utility: Captures the current pose and logs the JSON to console.
 * Usage: Call this from the browser console while holding a perfect pose.
 * @param {Array} landmarks - MediaPipe landmarks
 * @param {String} name - Name of the exercise
 */
export function capturePose(landmarks, name = "New Pose") {
    const vector = normalizeLandmarks(landmarks);
    if (!vector) {
        console.error("No landmarks detected.");
        return;
    }

    // Convert to regular array for JSON stringify
    const arrayData = Array.from(vector);

    // Format for easy copy-pasting into this file
    const output = `
    {
        name: "${name}",
        vector: new Float32Array([${arrayData.map(n => n.toFixed(4)).join(', ')}]),
        difficulty: "Beginner"
    },`;

    console.log(`%c[POSE CAPTURED] ${name}`, "color: #00ff00; font-weight: bold; font-size: 14px;");
    console.log(output);
    alert(`Pose "${name}" captured! Check console for JSON.`);
}
